import React from 'react'
import './cards.css'
import { CardsData } from '../Data/Data'


const Cards = () => {
  return (
    <div className="Cards">
        {CardsData.map((item, index) => {
            return(
               <div className="status-card">
                    <item.icon/>
                    <span>
                        {item.title}
                    </span>
               </div>
            
            )
        })}
    </div>
  )
}

export default Cards
